8	Web Developer	90	Koders is seeking some software development interns who are well versed in Python and MERN stack.  They should be able to work through the front-end and back-end skills. The intern will be working closely with the development team towards building the projects.\r\nOur website: Koders.in \r\nSend your resume at: koderskorp@gmail.com \r\n\r\nSkills Required:\r\n\r\n-They should have good analytical ability to tackle problem handling.\r\n-They should be ready to adapt to the changing environment in projects.\r\n-They should exhibit a willingness to learn.\r\n-They should be familiar with Java/Python, and/or MERN Stack.\r\n\r\nYour Day-to-Day Activities Should Include:\r\n1. Identify records, document thoroughly, and track bugs.\r\n2. Create detailed, comprehensive, and well-structured test plans and test cases.\r\n3. Estimate, prioritize, plan, and coordinate quality testing activities.\r\n4. Develop and apply testing processes for new and existing products.\r\n5. Monitor debugging process results.\r\n6. Work on performance testing, functional testing, scalability testing.\r\n7. Write well-designed, testable code.\r\n8. Integrate software components into a fully functional software system.\r\n9. Develop software verification plans and quality assurance procedures.\r\n10. Document and maintain software functionality.\r\n11. Troubleshoot, debug, and upgrade existing systems.\r\n12. Deploy programs and evaluate user feedback.\r\n13. Comply with project plans and industry standards.\r\n14. Ensure software is updated with the latest features.\r\n\r\nPerks:\r\n- Stipend/Monthly Based+ incentives\r\n- Certificate\r\n- Letter of Recommendation\r\n- Flexible Work Hours	users/projects/20/12/31/Assignment.docx	2020-12-31 15:25:41.492731+00	2021-01-25	web-developer	f	2	356
